import React from "react";

import MealsImg from "../../assets/meals.jpg";

const Header = (props) => {
  return (
    <>
      <header>
        <h1> ReactMeals </h1>
        <button> Cart </button>
      </header>
      <div>
        <img src={MealsImg} />
      </div>
    </>
  );
};

export default Header;
